/********************************************************************                
 *  Function handler: register_device (section mngmnt)
 ********************************************************************/               
int                                                                                                  
  ui_fap21v_api_mngmnt_register_device(                                                                             
    CURRENT_LINE *current_line                                                                       
  )                                                                                                  
{                                                                                                    
  uint32                                                                                           
    ret;                                                                                             
  uint32                                                                                            
    prm_base_address;                                                                                             
  SOC_SAND_RESET_DEVICE_FUNC_PTR                                                                                            
    prm_reset_device_ptr = NULL;
  uint32                                                                                            
    prm_unit_ptr;                                                                                             
                                                                                                     
  UI_MACROS_INIT_FUNCTION("ui_fap21v_api_mngmnt");                                                  
  soc_sand_proc_name = "fap21v_register_device";                                                              
                                                                                                     
  unit = get_default_unit(); 
                                                                                                     
  /* Get parameters */                                                                                
  if(!search_param_val_pairs(current_line,&match_index,PARAM_FAP21V_REGISTER_DEVICE_REGISTER_DEVICE_BASE_ADDRESS_ID,1))          
  {                                                                                                  
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_FAP21V_REGISTER_DEVICE_REGISTER_DEVICE_BASE_ADDRESS_ID);                             
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;                                                                
    prm_base_address = (uint32)param_val->value.ulong_value;
  }                                                                                                  
  else                                                                                               
  {                                                                                                  
    send_string_to_screen(" *** SW error - expecting parameter bse_ddrss after register_device***", TRUE);                                                                
    goto exit;
  }                                                                                                  

  if(!search_param_val_pairs(current_line,&match_index,PARAM_FAP21V_REGISTER_DEVICE_REGISTER_DEVICE_RESET_DEVICE_PTR_ID,1))          
  {                                                                                                  
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_FAP21V_REGISTER_DEVICE_REGISTER_DEVICE_RESET_DEVICE_PTR_ID);                             
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;                                                                
    prm_reset_device_ptr = (SOC_SAND_RESET_DEVICE_FUNC_PTR)param_val->value.ulong_value;
  }                                                                                                  
  else                                                                                               
  {                                                                                                  
    send_string_to_screen(" *** SW error - expecting parameter rst_dvc_ptr after register_device***", TRUE);                                                                
    goto exit;
  }                                                                                                  


  /* Call function */                                                                                
  ret = fap21v_register_device(
          &prm_base_address,
          prm_reset_device_ptr,
          &prm_unit_ptr
        );
  if (soc_sand_get_error_code_from_error_word(ret) != SOC_SAND_OK)                                                                                        
  {                                                                                                
    send_string_to_screen(" *** fap21v_register_device - FAIL", TRUE);                       
    fap21v_disp_result(ret, "fap21v_register_device");                         
    goto exit;                                                                                     
  }                                                                                                

  send_string_to_screen("--> unit_ptr:", TRUE);                   
  soc_sand_os_printf( "unit_ptr: %u\n",prm_unit_ptr);

                                                                                                     
  goto exit;                                                                                         
exit:                                                                                                
  return ui_ret;                                                                                     
}                                                                                                    
                                                                                                     
/********************************************************************                
 *  Function handler: unregister_device (section mngmnt)
 ********************************************************************/               
int                                                                                                  
  ui_fap21v_api_mngmnt_unregister_device(                                                                             
    CURRENT_LINE *current_line                                                                       
  )                                                                                                  
{                                                                                                    
  uint32                                                                                           
    ret;                                                                                             
                                                                                                     
  UI_MACROS_INIT_FUNCTION("ui_fap21v_api_mngmnt");                                                  
  soc_sand_proc_name = "fap21v_unregister_device";                                                              
                                                                                                     
  unit = get_default_unit(); 
                                                                                                     
  /* Get parameters */                                                                                

  /* Call function */                                                                                
  ret = fap21v_unregister_device(
          unit
        );
  if (soc_sand_get_error_code_from_error_word(ret) != SOC_SAND_OK)                                                                                        
  {                                                                                                
    send_string_to_screen(" *** fap21v_unregister_device - FAIL", TRUE);                       
    fap21v_disp_result(ret, "fap21v_unregister_device");                         
    goto exit;                                                                                     
  }                                                                                                

exit:                                                                                                
  return ui_ret;                                                                                     
}                                                                                                    
                                                                                                     
