/********************************************************************                
 *  Function handler: group_close (section multicast_egress)
 ********************************************************************/               
int                                                                                                  
  ui_fap21v_api_multicast_egress_group_test_run(                                                                             
    CURRENT_LINE *current_line                                                                       
  )                                                                                                  
{                                                                                                    
  uint32                                                                                           
    ret;                                                                                             
  uint32 
    pass1 = FALSE,
    pass2 = FALSE,
    nof_groups = 500;
  FAP21V_MULTICAST_EG_TABLE_MODE
    table_mode,
    table_mode_change;
                                                                                                     
  UI_MACROS_INIT_FUNCTION("");                                                  
  soc_sand_proc_name = "";                                                              
                                                                                                     
  unit = get_default_unit(); 

  fap21v_FAP21V_MULTICAST_EG_TABLE_MODE_clear(&table_mode);
  fap21v_FAP21V_MULTICAST_EG_TABLE_MODE_clear(&table_mode_change);

  if(!search_param_val_pairs(current_line,&match_index,PARAM_FAP21V_MULTICAST_EGRESS_TEST_RUN_NOF_GROUPS_ID,1))          
  {                                                                                                  
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_FAP21V_MULTICAST_EGRESS_TEST_RUN_NOF_GROUPS_ID);                             
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;                                                                
    nof_groups = (uint32)param_val->value.ulong_value;
  }                                                                                                  
  
  /* Get values from device                                                                               */
  ret = fap21v_multicast_egress_table_mode_get(
          unit,                  
          &table_mode
        );
  if (soc_sand_get_error_code_from_error_word(ret) != SOC_SAND_OK)                                                                                        
  {                                                                                                
    send_string_to_screen(" *** fap21v_multicast_egress_group_test_run - FAIL", TRUE);                       
    fap21v_disp_result(ret, "fap21v_multicast_egress_group_test_run");                         
    goto exit;                                                                                     
  }                                                                                                

  table_mode_change.four_k_enable = table_mode.four_k_enable;
  table_mode_change.mif_mode = table_mode.mif_mode;
  table_mode_change.top_port = table_mode.top_port;

  /* 4K disabled */
  table_mode_change.four_k_enable = FALSE;
  ret = fap21v_multicast_egress_table_mode_set(
          unit,
          &table_mode_change
        );
  if (soc_sand_get_error_code_from_error_word(ret) != SOC_SAND_OK)                                                                                        
  {                                                                                                
    send_string_to_screen(" *** fap21v_multicast_egress_group_test_run - FAIL", TRUE);                       
    fap21v_disp_result(ret, "fap21v_multicast_egress_group_test_run");                         
    goto exit;                                                                                     
  }                                                                                                

  ret = fap21v_multicast_egress_all_groups_close(
          unit
        );
  if (SOC_SAND_OK != soc_sand_get_error_code_from_error_word(ret))
  {
    send_string_to_screen(" *** fap21v_multicast_egress_group_test_run - FAIL", TRUE);                       
    fap21v_disp_result(ret, "fap21v_multicast_egress_group_test_run");                         
    goto exit;                                                                                     
  }
  
  pass1 = fap21v_multicast_egress_TEST(
            unit, 
            2,
            nof_groups,
            FALSE
          );

  /* 4K enabled */
  table_mode_change.four_k_enable = TRUE;
  ret = fap21v_multicast_egress_table_mode_set(
          unit,
          &table_mode_change
        );
  if (soc_sand_get_error_code_from_error_word(ret) != SOC_SAND_OK)                                                                                        
  {                                                                                                
    send_string_to_screen(" *** fap21v_multicast_egress_group_test_run - FAIL", TRUE);                       
    fap21v_disp_result(ret, "fap21v_multicast_egress_group_test_run");                         
    goto exit;                                                                                     
  }                                                                                                

  ret = fap21v_multicast_egress_all_groups_close(
          unit
        );
  if (SOC_SAND_OK != soc_sand_get_error_code_from_error_word(ret))
  {
    send_string_to_screen(" *** fap21v_multicast_egress_group_test_run - FAIL", TRUE);                       
    fap21v_disp_result(ret, "fap21v_multicast_egress_group_test_run");                         
    goto exit;                                                                                     
  }
  
  pass2 = fap21v_multicast_egress_TEST(
            unit, 
            2,
            nof_groups,
            FALSE
          );

  /* Restore values to device                                                                             */
  ret = fap21v_multicast_egress_table_mode_set(
          unit,
          &table_mode
        );
  if (soc_sand_get_error_code_from_error_word(ret) != SOC_SAND_OK)                                                                                        
  {                                                                                                
    send_string_to_screen(" *** fap21v_multicast_egress_group_close - FAIL", TRUE);                       
    fap21v_disp_result(ret, "fap21v_multicast_egress_group_close");                         
    goto exit;                                                                                     
  }                                                                                                

exit:                                                                                
  
  soc_sand_os_printf( "Multicast egress test - %s\n", (pass1 && pass2 ? "PASS" : "FAIL"));
  return ui_ret;                                                                                     
}                                                                                                    
                                                                                                     
