int                                                                                                  
  ui_fap21v_api_general_generic_code_test(                                                                             
    CURRENT_LINE *current_line                                                                       
  )                                                                                                  
{                                                                                                    
  uint32                                                                                           
    ret;                                                                                             
                                                                                                     
  UI_MACROS_INIT_FUNCTION("ui_fap21v_api_general");                                                  
  soc_sand_proc_name = "fap21v_interrupt_handler";                                                              
                                                                                                     
  unit = get_default_unit(); 
                                                                                                     
  {
    FAP21V_MULTICAST_EG
      mul_eg_1,
      mul_eg_2;

    ret = fap21v_sw_db_multicast_egress_get(
            unit,
            &mul_eg_2
          );
    if (soc_sand_get_error_code_from_error_word(ret) != SOC_SAND_OK)                                                                                        
    {                                                                                                
      send_string_to_screen(" *** ui_fap21v_api_general_generic_code_test - FAIL", TRUE);                       
      fap21v_disp_result(ret, "ui_fap21v_api_general_generic_code_test");                         
      goto exit;                                                                                     
    }                                                                                                

    ret = fap21v_multicast_egress_MULTICAST_EG_from_EGQ_FOP_MULTICAST_LUT_TBL_get(
            unit,
            &mul_eg_1
          );
    if (soc_sand_get_error_code_from_error_word(ret) != SOC_SAND_OK)                                                                                        
    {                                                                                                
      send_string_to_screen(" *** ui_fap21v_api_general_generic_code_test - FAIL", TRUE);                       
      fap21v_disp_result(ret, "ui_fap21v_api_general_generic_code_test");                         
      goto exit;                                                                                     
    }                                                                                                

    ret = sal_memcmp(&(mul_eg_1.ll_search_type), &(mul_eg_2.ll_search_type), sizeof(uint32));
    soc_sand_os_printf( "mul_eg_1.ll_search_type:         %lu\n", ret);
    ret = sal_memcmp(&(mul_eg_1.prev), &(mul_eg_2.prev), FAP21V_MULTICAST_EG_NOF_ENTRIES * sizeof(uint16));
    soc_sand_os_printf( "mul_eg_1.prev:                   %lu\n", ret);
    ret = sal_memcmp(&(mul_eg_1.taken_fop_multicast_id), &(mul_eg_2.taken_fop_multicast_id), FAP21V_MULTICAST_ID_LUT_NOF_LONGS * sizeof(uint32));
    soc_sand_os_printf( "mul_eg_1.taken_fop_multicast_id: %lu\n", ret);
    ret = sal_memcmp(&(mul_eg_1.use_for_bitmap), &(mul_eg_2.use_for_bitmap), FAP21V_MULTICAST_ID_LUT_NOF_LONGS * sizeof(uint32));
    soc_sand_os_printf( "mul_eg_1.use_for_bitmap:         %lu\n", ret);
  }
   
  goto exit;                                                                                         
exit:                                                                                                
  return ui_ret;                                                                                     
}

