/********************************************************************                
 *  Function handler: diag_lbg_packet_send (section diagnostics)
 ********************************************************************/               
int                                                                                                  
  ui_fap21v_api_diagnostics_diag_lbg_packet_send(                                                                             
    CURRENT_LINE *current_line                                                                       
  )                                                                                                  
{                                                                                                    
  uint32                                                                                           
    ret;                                                                                             
  uint32                                                                                            
    prm_pkt_byte_size = 128;                                                                                             
  uint32                                                                                            
    prm_nof_pkt = 100;                                                                                             
  uint32
    ind;
  uint8                                                                                            
    prm_pad_data[FAP21V_CPU_TX_FRAG_BYTE_SIZE];                                                                                             
  uint8                                                                                            
    prm_silent = FALSE;                                                                                             
                                                                                                     
  UI_MACROS_INIT_FUNCTION("ui_fap21v_api_diagnostics");                                                  
  soc_sand_proc_name = "fap21v_diag_lbg_packet_send";                                                              
                                                                                                     
  unit = get_default_unit(); 
                     
  sal_memset(prm_pad_data, 0x0, FAP21V_CPU_TX_FRAG_BYTE_SIZE * sizeof(uint8));

  /* Get parameters */                                                                                
  if(!search_param_val_pairs(current_line,&match_index,PARAM_FAP21V_DIAG_LBG_PACKET_SEND_DIAG_LBG_PACKET_SEND_PKT_BYTE_SIZE_ID,1))          
  {                                                                                                  
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_FAP21V_DIAG_LBG_PACKET_SEND_DIAG_LBG_PACKET_SEND_PKT_BYTE_SIZE_ID);                             
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;                                                                
    prm_pkt_byte_size = (uint32)param_val->value.ulong_value;
  }                                                                                                                                                                                                   

  if(!search_param_val_pairs(current_line,&match_index,PARAM_FAP21V_DIAG_LBG_PACKET_SEND_DIAG_LBG_PACKET_SEND_NOF_PKT_ID,1))          
  {                                                                                                  
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_FAP21V_DIAG_LBG_PACKET_SEND_DIAG_LBG_PACKET_SEND_NOF_PKT_ID);                             
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;                                                                
    prm_nof_pkt = (uint32)param_val->value.ulong_value;
  }                                                                                                

  if(!search_param_val_pairs(current_line,&match_index,PARAM_FAP21V_DIAG_LBG_PACKET_SEND_DIAG_LBG_PACKET_SEND_PAD_DATA_0_ID,1))          
  {                                                                                                  
    for (ind = 0; ind < FAP21V_CPU_TX_FRAG_BYTE_SIZE; ++ind)
    {
      UI_MACROS_GET_NUMMERIC_VAL_WITH_INDEX(PARAM_FAP21V_DIAG_LBG_PACKET_SEND_DIAG_LBG_PACKET_SEND_PAD_DATA_0_ID, ind + 1);                             
      prm_pad_data[ind] = ui_ret ? 0 : (uint8)param_val->value.ulong_value;
  }                                                                                                  
  }                                        

  if(!search_param_val_pairs(current_line,&match_index,PARAM_FAP21V_DIAG_LBG_PACKET_SEND_DIAG_LBG_PACKET_SEND_SILENT_ID,1))          
  {                                                                                                  
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_FAP21V_DIAG_LBG_PACKET_SEND_DIAG_LBG_PACKET_SEND_SILENT_ID);                             
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;                                                                
    prm_silent = (uint8)param_val->value.ulong_value;
  }                                                                                                  
  else                                                                                               
  {                                                                                                  
    send_string_to_screen(" *** SW error - expecting parameter slnt after diag_lbg_packet_send***", TRUE);                                                                
    goto exit; 
  }                                                                                                  

  /* Call function */                                                                                
  ret = fap21v_diag_lbg_packet_send(
          unit,
          prm_pkt_byte_size,
          prm_nof_pkt,
          prm_pad_data,
          prm_silent
        );
  if (soc_sand_get_error_code_from_error_word(ret) != SOC_SAND_OK)                                                                                        
  {                                                                                                
    send_string_to_screen(" *** fap21v_diag_lbg_packet_send - FAIL", TRUE);                       
    fap21v_disp_result(ret, "fap21v_diag_lbg_packet_send");                         
    goto exit;                                                                                     
  }                                                                                                

exit:                                                                                                
  return ui_ret;                                                                                     
}                                                                                                    
                                                                                                     
