  {                                                                                                  
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_FAP21V_API_DIAG_ZBT_SET_DATA_2_ID);                             
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;                                                                
    data[1] = (uint32)param_val->value.ulong_value;
  }                                                                                                  

