int                                                                                                  
  ui_fap21v_api_access_direct_write(     
    uint32 value,
    CURRENT_LINE *current_line                                                                       
  )                                                                                                  
{      
  uint32
    ret;
  uint32
    offset,
    mask = 0xffffffff,
    shift = 0;

  UI_MACROS_INIT_FUNCTION("ui_fap21v_api_access_direct_write");                                                  
                                                                                                     
  if (!search_param_val_pairs(current_line,&match_index,PARAM_FAP21V_API_DIRECT_ADDRESS_ID,1))
  {
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_FAP21V_API_DIRECT_ADDRESS_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    offset = param_val->value.ulong_value;
  }
  else
  {
    send_string_to_screen(" *** SW error - expecting function name after direct_write ***", TRUE);
    goto exit;
  }

  if(!search_param_val_pairs(current_line,&match_index,PARAM_FAP21V_API_DIRECT_ADDRESS_MASK_ID,1))
  {
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_FAP21V_API_DIRECT_ADDRESS_MASK_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    mask = (uint32)param_val->value.ulong_value;
  }
  if(!search_param_val_pairs(current_line,&match_index,PARAM_FAP21V_API_DIRECT_ADDRESS_SHIFT_ID,1))
  {
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_FAP21V_API_DIRECT_ADDRESS_SHIFT_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    shift = (uint32)param_val->value.ulong_value;
  }

  ret = soc_sand_read_modify_write(
        soc_sand_get_chip_descriptor_base_addr(unit),
        offset * sizeof(uint32),
        shift,
        mask,
        value
      );
  if (soc_sand_get_error_code_from_error_word(ret) != SOC_SAND_OK)
  {
    send_string_to_screen(" *** soc_sand_write_modify_write - FAIL", TRUE);
    fap21v_disp_result(ret, "soc_sand_write_modify_write");
    goto exit;
  }
  
             
  goto exit;                                                                                         
exit:                                                                                                
  return ui_ret;                                                                                     
}                                                                                                    
 
int                                                                                                  
  ui_fap21v_api_access_direct_read(     
    CURRENT_LINE *current_line                                                                       
  )                                                                                                  
{      
  uint32
    ret,
    offset,
    data_out;
  uint32
    *base_addr;

  UI_MACROS_INIT_FUNCTION("ui_fap21v_api_access_direct_read");                                                  

  if (!search_param_val_pairs(current_line,&match_index,PARAM_FAP21V_API_DIRECT_READ_ADDRESS_ID,1))
  {
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_FAP21V_API_DIRECT_READ_ADDRESS_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    offset = param_val->value.ulong_value;
  }
  else
  {
    send_string_to_screen(" *** SW error - expecting function name after direct_write ***", TRUE);
    goto exit;
  }

  base_addr = soc_sand_get_chip_descriptor_base_addr(unit);
  if (!base_addr)
  {
    send_string_to_screen(" *** soc_sand_get_chip_descriptor_base_addr - FAIL", TRUE);
    fap21v_disp_result(0, "soc_sand_get_chip_descriptor_base_addr");
    goto exit;
  }

  ret = soc_sand_physical_read_from_chip(
          &data_out, 
          base_addr, 
          offset * sizeof(uint32), 
          sizeof(uint32)
          );
  if (soc_sand_get_error_code_from_error_word(ret) != SOC_SAND_OK)
  {
    send_string_to_screen(" *** soc_sand_physical_read_from_chip - FAIL", TRUE);
    fap21v_disp_result(ret, "soc_sand_physical_read_from_chip");
    goto exit;
  }

 soc_sand_os_printf(  "data_out: 0x%lx\n" , data_out ) ;


  goto exit;                                                                                         
exit:                                                                                                
  return ui_ret;                                                                                     
}                      

int                                                                                                  
  ui_fap21v_api_access(                                                                             
    CURRENT_LINE *current_line                                                                       
  )                                                                                                  
{      
  uint32
    ret;

  UI_MACROS_INIT_FUNCTION("ui_fap21v_api_access");                                                  
                                                                                                     
  if (!search_param_val_pairs(current_line,&match_index,PARAM_FAP21V_API_DIRECT_WRITE_ID,1))
  {
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_FAP21V_API_DIRECT_WRITE_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    ret = ui_fap21v_api_access_direct_write(param_val->value.ulong_value, current_line);
  }
  else if (!search_param_val_pairs(current_line,&match_index,PARAM_FAP21V_API_DIRECT_READ_ID,1))
  {
    ret = ui_fap21v_api_access_direct_read(current_line); 
  }
  else
  {
    send_string_to_screen(" *** SW error - expecting function name after direct_write ***", TRUE);
    goto exit;
  }

exit:                                                                                                
  return ui_ret;                                                                                     
}                                                                                                    
 
